import React from 'react';
import Footer from './component/Footer';
import Header from './component/Header';
import Main from './component/Main';
import data from './sets/data.json';

class App extends React.Component {
  constructor(props){
    super(props);

    this.state={
      element:data,
      show:false,
      obj:{}
    };
  }
  shoeElement=(event)=>{
    this.setState({
      show:true,
      obj:event,
    })
console.log(event);
  }
  render() {
    return (
      <div>
        <Header />
        <Main data={this.state.element} />
        <Footer />
      </div>
    );
  }
}

export default App;
